import React from 'react'
import { StyledContainer } from "./container.styles";
import { IContainerProps } from "./container.types";

export default function Container({ children }: React.FC<IContainerProps>) {
  return (
    <StyledContainer>
      {children}
    </StyledContainer>
  )
}
